// ============================================================
// Import packages
import React from 'react';
import { Typography } from 'antd';
import PropTypes from 'prop-types';


// ============================================================
// Components
const Text = ({child, strong})=>{
    return (<Typography.Text strong={strong}>{child}</Typography.Text>)
};


Text.propTypes = {
    child  : PropTypes.node.isRequired,

};

// ============================================================
// Exports
export {Text};
